(18, '04cdd8941f09d37', '华佑装饰集团', '华佑装饰', 0, 'http://test.weiwinbao.com/uploads/0/04cdd8941f09d37/5/f/b/1/thumb_537efff815ca4.png', 0, 0, 0, '/sucai/zhuangxiu/2.png', '/sucai/zhuangxiu/4.png', '江西省吉安市青原区烟草', '115.018035', '27.09109', '<span style="font-family:宋体;color:blue;">我们的宗旨：</span><span style="font-family:宋体;">让家装更透明，给百姓更省钱！</span><span style="font-family:Arial;"></span> \r\n<p class="MsoNormal">\r\n	<span style="font-family:宋体;color:blue;">我们的承诺：</span><span style="font-family:宋体;">不满意，砸掉重装！</span><span style="font-family:Arial;"></span> \r\n</p>\r\n<p class="MsoNormal">\r\n	<span style="font-family:宋体;color:blue;">我们的服务：</span><span style="font-family:宋体;">打造“</span><span style="font-family:Arial;">0</span><span style="font-family:宋体;">”投诉，把客户的想象变成现实！</span><span style="font-family:Arial;"></span> \r\n</p>\r\n<p class="MsoNormal">\r\n	<span style="font-family:宋体;color:blue;">我们的愿景：</span><span style="font-family:宋体;">打造中国最强大的一站式装修服务集团！</span><span style="font-family:Arial;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-family:宋体;color:blue;">我们的使命：</span><span style="font-family:宋体;">实在、实惠、更时尚，</span><span style="font-family:宋体;">咱老百姓自己的家装公司！</span><span style="font-family:Arial;"></span> \r\n</p>\r\n<p class="MsoNormal">\r\n	<span style="font-family:宋体;color:blue;">我们的理念：</span><span style="font-family:宋体;">开拓、创新、务实、超越</span><span style="font-family:Arial;"></span> \r\n</p>', '<p>\r\n	<span style="font-family:宋体;"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>华佑积家集团（以下简称“华佑积家”）创始于</span><span style="font-family:Arial;color:red;">1997</span><span style="font-family:宋体;">年，涉足矿业、钢贸、物流及家装四大发展领域，实现多元经营。</span> \r\n</p>\r\n<p>\r\n	<span style="font-family:宋体;">&nbsp;&nbsp;&nbsp; </span><span style="font-family:宋体;background:white;">凭借多年的项目施工与整合运营经验，<span>2011</span>年初，华佑积家在武汉开设第一家工厂店，以创新者的姿态正式进军家装领域，首推</span><span style="font-family:宋体;">集基材、主材、设计、家具、家电及软饰为一体的第五代总成“买家”模式</span><span style="font-family:宋体;background:white;">，打造中国家装真正意义上的一站式服务体系。</span><span style="font-family:宋体;">通过整合质保资质认证、管理规范、运作良好、示范性强的本土建材行业资源，华佑积家全新定义了品牌家装的价格基准。</span><span style="font-family:Arial;"></span> \r\n</p>\r\n<p style="text-indent:21pt;" class="MsoNormal">\r\n	<span style="font-family:宋体;">如今，华佑积家</span><span style="font-family:宋体;background:white;">先后在合肥、无锡、南宁、吉安等城市开设了<span>5</span>家工厂店，拥有数百名内部培养的精英技术工人，全国几万平米的材料展厅和产品体验馆，同时拥有国内一流的设计师团队和遍布全球的供应链合作伙伴。<span></span></span> \r\n</p>\r\n<span style="font-family:宋体;background:white;font-size:10.5pt;">&nbsp;&nbsp;&nbsp; 为了给消费者带来更美好的家居生活，华佑积家将进行长期不懈的调整和努力，</span><span style="font-family:宋体;background:white;font-size:10.5pt;">以“让家装更透明、让百姓更省钱”为宗旨，</span><span style="font-family:宋体;font-size:10.5pt;">让</span><span style="font-family:宋体;font-size:10.5pt;">普通百姓花最少的钱住上自己最心仪的家！</span>', '家庭装修、旧房改造、别墅装潢、设计、施工配套服务、材料选购、家具家电打包选购', 'zhuangxiu', '0796-7030777,7030789', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
