(11, '华佑装饰集团  咱老百姓自己的家装公司', '“大全包”来了！华佑装饰首创——所有人工、设计、水电、瓷砖、地板、卫浴等基础装修通通包；全房家具、灯具、窗帘等配饰样样送；甚至连售后维修都全部解决！一口价，一线品牌，让装修一站到底！咨询热线：0796-7030777,7030789。', 'http://test.weiwinbao.com/uploads/0/04cdd8941f09d37/1/3/3/b/thumb_537ebd318afd9.png', '04cdd8941f09d37', 'v_25', 'http://test.weiwinbao.com/cms/upload/images/2014/05/23/1400854263vPys.png', '', 0, 0, 0, NULL, '', 0),
(12, '珠海世恒欢迎您！', '花生油营养分析\r\n1 营养分析\r\n　　中国预防医学科学院经研究证实：\r\n　　花生油含锌量是色拉油、粟米油、菜籽油、豆油的许多倍。虽然补锌的途径很多，但油脂是人们日常必需的补充物，所以食用花生油特别适宜于大众补锌花生油中还含有多种抗衰老成分，', 'http://test.weiwinbao.com/tpl/static/attachment/background/view/3.jpg', 'zjxkgy1400897053', 'v_25', 'http://test.weiwinbao.com/cms/upload/images/2014/05/24/1400898074LBWx.jpg', '', 0, 0, 0, NULL, '', 0),
